import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import { FaBars, FaTimes } from 'react-icons/fa';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const location = useLocation();

  const toggleMenu = () => setIsOpen(!isOpen);
  const closeMenu = () => setIsOpen(false);

  const isActive = (path) => location.pathname === path;

  return (
      <nav className="navbar">
        <div className="container">
          <div className="navbar-container">
            <Link to="/" className="navbar-logo" onClick={closeMenu}>
              AquaTech Solutions NZ
            </Link>
            <ul className={`nav-menu ${isOpen ? 'nav-menu-open' : ''}`}>
              <li>
                <Link 
                  to="/" 
                  className={`nav-link ${isActive('/') ? 'active' : ''}`}
                  onClick={closeMenu}
                >
                  Home
                </Link>
              </li>
              <li>
                <Link 
                  to="/services" 
                  className={`nav-link ${isActive('/services') ? 'active' : ''}`}
                  onClick={closeMenu}
                >
                  Services
                </Link>
              </li>
              <li>
                <Link 
                  to="/distillation" 
                  className={`nav-link ${isActive('/distillation') ? 'active' : ''}`}
                  onClick={closeMenu}
                >
                  Distillation
                </Link>
              </li>
              <li>
                <Link 
                  to="/extraction" 
                  className={`nav-link ${isActive('/extraction') ? 'active' : ''}`}
                  onClick={closeMenu}
                >
                  Extraction
                </Link>
              </li>
              <li>
                <Link 
                  to="/reaction" 
                  className={`nav-link ${isActive('/reaction') ? 'active' : ''}`}
                  onClick={closeMenu}
                >
                  Reaction
                </Link>
              </li>
              <li>
                <Link 
                  to="/rating-curves" 
                  className={`nav-link ${isActive('/rating-curves') ? 'active' : ''}`}
                  onClick={closeMenu}
                >
                  Rating Curves
                </Link>
              </li>
              <li>
                <Link 
                  to="/qmra" 
                  className={`nav-link ${isActive('/qmra') ? 'active' : ''}`}
                  onClick={closeMenu}
                >
                  QMRA
                </Link>
              </li>
              <li>
                <Link 
                  to="/mechanistic-analysis" 
                  className={`nav-link ${isActive('/mechanistic-analysis') ? 'active' : ''}`}
                  onClick={closeMenu}
                >
                  Mechanistic Analysis
                </Link>
              </li>
              <li>
                <Link 
                  to="/machine-learning" 
                  className={`nav-link ${isActive('/machine-learning') ? 'active' : ''}`}
                  onClick={closeMenu}
                >
                  Machine Learning
                </Link>
              </li>
              <li>
                <Link 
                  to="/about" 
                  className={`nav-link ${isActive('/about') ? 'active' : ''}`}
                  onClick={closeMenu}
                >
                  About
                </Link>
              </li>
              <li>
                <Link 
                  to="/contact" 
                  className={`nav-link ${isActive('/contact') ? 'active' : ''}`}
                  onClick={closeMenu}
                >
                  Contact
                </Link>
              </li>
            </ul>
            <button className="mobile-menu-btn" onClick={toggleMenu}>
              {isOpen ? <FaTimes /> : <FaBars />}
            </button>
          </div>
        </div>
      </nav>
  );
};

export default Navbar;
